import React from "react";
import { Image, StyleSheet } from "react-native";

function ViewImageScreen(props) {
  return (
    <Image
      style={styles.image}
      source={require("../assets/products/animage.jpg")}
    />
  );
}

const styles = StyleSheet.create({
  Image: {
    width: "100%",
    height: "100%",
  },
});
export default ViewImageScreen;
